import React, { useState } from "react";
import "./Form.css"
const Form = ()=>{
    
 const [name , setName] = useState("Hello")

 const updatedHandler =()=>{
    
    setName()
 }
 return(
    <div className="container">
     <h1>{name}</h1>
     <input type="text" onChange={updatedHandler } placeholder="Enter your name" /><br /><br />
     <button >Click me</button>
    </div>
 )
}

export default Form;
